import HomePage from './Pages/Home/HomePages';

import {BrowserRouter ,Routes, Route} from 'react-router-dom'
import NavBarLogin from './Components/Uitily/NavBarLogin'
import Footer from './Components/Uitily/Footers'
import LoginPag from './Components'

function App() {
  return (
    <div className="font">
    <NavBarLogin />
    <BrowserRouter>
      <Routes>
       <Route index element={<HomePage/>}  />  
       <LoginPag />
      </Routes>
    </BrowserRouter>
    <Footer />
    </div>
  );
}

export default App;
